function arclab_Error($error)
{
header('Content-Type: text/html; charset=utf-8');
echo "function awf_Run(id)\r\n{\r\ndocument.getElementById(id).innerHTML=\"$error\";\r\n}\r\n";
exit();
}

////////////////////////////////////////////////////////////////////////////////////////////////////
function arclab_InputUTF8($a)
{
if(mb_detect_encoding($a)=="UTF-8"&&mb_check_encoding($a,"UTF-8"))return $a;
return utf8_encode($a); 
}

function arclab_VarToHTML($a)
{
$b=nl2br(htmlspecialchars($a,ENT_QUOTES,'UTF-8'));
return trim($b);
}

function arclab_isEmail($a)
{
//return filter_var($a,FILTER_VALIDATE_EMAIL);
$p="/^[^@,;:\x22\s<>()\[\]]+@[^@,;:\s\x22\x27<>()\[\]+!#$%&]+\.[^@,;:\s\x22\x27<>()\[\]+!#$%&]+$/";
return preg_match($p, $a);
}

function arclab_isASCII($s)
{
return mb_detect_encoding($s,'ASCII',true);
}

function arclab_EncodeEmailIDN($a)
{
if(!function_exists('idn_to_ascii'))return $a;
$p=explode('@',$a);
if(count($p)==2)
{
$a=$p[0].'@'.idn_to_ascii($p[1]);
}
return $a;
}

function arclab_FilterHeader($a)
{
$r=array('/(\n+)/i','/(\r+)/i','/(\t+)/i','/(%0A+)/i','/(%0D+)/i','/(%08+)/i','/(%09+)/i');
$b=preg_replace($r,'',$a);
return $b;
}

function arclab_EncodeHeader($a,$i)
{
return mb_encode_mimeheader($a,'UTF-8','B',PHP_EOL,strlen($i));
}

function arclab_EncodeHeaderEmail($a,$b,$i)
{
$a=arclab_FilterHeader($a);
$b=arclab_FilterHeader($b);
if(!arclab_isEmail($b))return '';
$e='';
if(!empty($a))
{
$e="\"".mb_encode_mimeheader($a,'UTF-8','B',PHP_EOL,strlen($i))."\"";
}
if(!empty($b))
{
$t='<'.arclab_EncodeEmailIDN($b).'>';
if(strpos($e,PHP_EOL)||(strlen($i)+strlen($e)+strlen($t)>76))$e.=PHP_EOL;
if(!empty($e))$e.=' ';
$e.=$t;
return $e;
}
return '';
}

function arclab_isUploadValid($v,$e,$s,$n,$r)
{
$c=0;
if(!isset($_FILES[$v])){if($r)return false;else return true;}
foreach($_FILES[$v]['tmp_name'] as $i => $FTN)
{
if(!empty($_FILES[$v]['error'][$i]))return false;
if(empty($FTN)||!is_uploaded_file($FTN))return false;
$FN=$_FILES[$v]['name'][$i];
$FS=$_FILES[$v]['size'][$i];
if(!empty($e)){if(!preg_match('/(.*?)\.('.$e.')$/',strtolower($FN)))return false;}
if($FS>$s)return false;	
$c++;
}
if($c>$n)return false;
return true;
}

function arclab_EncodeBody($a,$p)
{
if($p)return "Content-Transfer-Encoding: 8bit\r\n\r\n".$a;
return "Content-Transfer-Encoding: base64\r\n\r\n".chunk_split(base64_encode($a));
}

function arclab_ConvertNumeric($s)
{
$ic=strpos($s,','); $ip=strpos($s,'.');
if($ic!==FALSE&&$ip!==FALSE)
{
if($ic>$ip)$s=str_replace(',','',$s);
if($ic<$ip){$s=str_replace('.','',$s);$s=str_replace(',','.',$s);}
}
else
{
if($ic!==FALSE)$s=str_replace(',','.',$s);
}
return floatval($s);
}

function arclab_DecPl($f,$n)
{
return number_format($f,$n,'.','');
}

function arclab_ConvertDateTime($year,$month,$day,$hour,$min,$sec)
{
return sprintf('%04d-%02d-%02d %02d:%02d:%02d',(int)$year,(int)$month,(int)$day,(int)$hour,(int)$min,(int)$sec);
}

function arclab_ConvertDate($year,$month,$day)
{
return sprintf('%04d-%02d-%02d',(int)$year,(int)$month,(int)$day);
}

function arclab_ConvertTime($hour,$min,$sec)
{
return sprintf('%02d:%02d:%02d',(int)$hour,(int)$min,(int)$sec);
}

function arclab_ConvertBoolean($s)
{
if(empty($s))return 0;
$s=strtoupper($s);
if($s=='TRUE'||$s=='YES'||$s=='Y'||$s=='ON'||$s=='WAHR'||$s=='JA'||$s=='J'||$s=='AN')return 1;
if($s=='FALSE'||$s=='NO'||$s=='N'||$s=='OFF'||$s=='FALSCH'||$s=='NEIN'||$s=='AUS')return 0;
if(s==0) return 0; else return 1;
}

function arclab_UUIDv4()
{
return sprintf('%04x%04x-%04x-%04x-%04x-%04x%04x%04x',mt_rand(0,0xffff),mt_rand(0,0xffff),mt_rand(0,0xffff),mt_rand(0,0x0fff)|0x4000,mt_rand(0,0x3fff)|0x8000,mt_rand(0,0xffff),mt_rand(0,0xffff),mt_rand(0,0xffff));
}

