function arclab_Submit()
{
if(strtolower($_SERVER['REQUEST_METHOD'])!=='post')arclab_SubmitDone('E001');
$ID17='';if(isset($_POST['ID17']))$ID17=arclab_InputUTF8($_POST['ID17']);if($ID17===null||$ID17==='')arclab_SubmitDone('E002/ID17');
$ID34='';if(isset($_POST['ID34']))$ID34=arclab_InputUTF8($_POST['ID34']);if($ID34===null||$ID34==='')arclab_SubmitDone('E002/ID34');
// SA/0 ---
$ok=true;
$h_from=arclab_EncodeHeaderEmail("info@fiscogea.com","info@fiscogea.com","From: ");
$h_replyto=arclab_EncodeHeaderEmail("",$ID17,"Reply-To: ");
$h_to=arclab_EncodeHeaderEmail("","info@fiscogea.com","To: ");
$h_cc='';
$h_bcc='';
$h_subject=arclab_EncodeHeader(arclab_FilterHeader(""),"Subject: ");
$b_txt='';
$b_html="<html>\r\n<head>\r\n<meta content=\"text/html; charset=utf-8\" http-equiv=\"Content-Type\">\r\n<meta content=\"width=device-width, initial-scale=1.0\" name=\"viewport\">\r\n<meta content=\"IE=edge\" http-equiv=\"X-UA-Compatible\">\r\n<style>\r\n*{-webkit-box-sizing:border-box;-moz-box-sizing:border-box;box-sizing:border-box;}\r\ndiv,table,th,tr,td,tbody{margin:0;padding:0;}\r\nbody{-webkit-text-size-adjust:100%;-ms-text-size-adjust:100%;}\r\ntable,td{border-collapse:collapse;}\r\ntable{mso-table-lspace:0pt;mso-table-rspace:0pt;}\r\nbody {background-color:white;}\r\n.t-b {width:700px;background-color:white;}\r\n.t-t {width:100%;margin:5px 0;}\r\n.t-l {width:40%;color:dimgray;font-family:Calibri,Arial,sans-serif;font-size:12pt;font-weight:normal;vertical-align:top;}\r\n.t-r {width:60%;color:black;font-family:Calibri,Arial,sans-serif;font-size:12pt;font-weight:normal;vertical-align:top;}\r\n</style>\r\n</head>\r\n<body>\r\n<table class=\"t-b\"><tr><td class=\"t-c\">\r\n<table class=\"t-t\"><tr><td class=\"t-l\">MAIL:</td><td class=\"t-r\">".arclab_VarToHTML($ID17)."</td></tr></table>\r\n<table class=\"t-t\"><tr><td class=\"t-l\">Unnamed ID34:</td><td class=\"t-r\">".arclab_VarToHTML($ID34)."</td></tr></table>\r\n</td></tr></table>\r\n</body>\r\n</html>\r\n";
$b_mix='--=AWFB_M_'.md5(time());
$b_alt='--=AWFB_A_'.md5(time());
$h_content='';
$mime='';
$b_plain=false;
$na=0;
$h_add_cte='';
if($na>0)
{
$h_content="multipart/mixed;\r\n boundary=\"$b_mix\"";
$mime.="--$b_mix\r\n";
if(empty($b_html)&&!empty($b_txt))
{
$mime.="Content-Type: text/plain; charset=utf-8\r\n";
$mime.=arclab_EncodeBody($b_txt,$b_plain);
}
if(!empty($b_html)&&empty($b_txt))
{
$mime.="Content-Type: text/html; charset=utf-8\r\n";
$mime.=arclab_EncodeBody($b_html,$b_plain);
}
if(!empty($b_html)&&!empty($b_txt))
{
$mime.="Content-Type: multipart/alternative;\r\n boundary=\"$b_alt\"\r\n\r\n";
$mime.="This is a multi-part message in MIME format.\r\n\r\n--$b_alt\r\nContent-Type: text/plain; charset=utf-8\r\n";
$mime.=arclab_EncodeBody($b_txt,$b_plain);
$mime.="\r\n--$b_alt\r\nContent-Type: text/html; charset=utf-8\r\n";
$mime.=arclab_EncodeBody($b_html,$b_plain);
$mime.="\r\n--$b_alt--\r\n";
}
$mime.="\r\n--$b_mix--";
}
else
{
if(empty($b_html)&&!empty($b_txt))
{
$h_content="text/plain; charset=utf-8";	
if($b_plain){$mime.=$b_txt; $h_add_cte.="8bit";}else{$mime.=chunk_split(base64_encode($b_txt));$h_add_cte.="base64";}
}
if(!empty($b_html)&&empty($b_txt))
{
$h_content="text/html; charset=utf-8";
if($b_plain){$mime.=$b_html; $h_add_cte.="8bit";}else{$mime.=chunk_split(base64_encode($b_html));$h_add_cte.="base64";}
}
if(!empty($b_html)&&!empty($b_txt))
{
$h_content="multipart/alternative;".PHP_EOL." boundary=\"$b_alt\"";
$h_add_cte='';
$mime.="This is a multi-part message in MIME format.\r\n\r\n--$b_alt\r\nContent-Type: text/plain; charset=utf-8\r\n";
$mime.=arclab_EncodeBody($b_txt,$b_plain);
$mime.="\r\n--$b_alt\r\nContent-Type: text/html; charset=utf-8\r\n";
$mime.=arclab_EncodeBody($b_html,$b_plain);
$mime.="\r\n--$b_alt--\r\n";
}
}
$header='';
if(!empty($h_bcc))$header.="Bcc: $h_bcc".PHP_EOL;
if(!empty($h_cc))$header.="Cc: $h_cc".PHP_EOL;
$header.="From: $h_from".PHP_EOL;
if(!empty($h_replyto))$header.="Reply-To: $h_replyto".PHP_EOL;
$header.="MIME-Version: 1.0".PHP_EOL;
$header.="Content-Type: $h_content".PHP_EOL;
if(!empty($h_add_cte))$header.="Content-Transfer-Encoding: $h_add_cte".PHP_EOL;
if(empty($h_to))$ok=false;
if($ok)$ok=mail($h_to,$h_subject,$mime,$header);
if($ok!==true)arclab_SubmitDone('E100/1');
arclab_SubmitDone();
}

function arclab_SubmitDone($err='')
{
header('Content-Type: text/html; charset=utf-8');
if($err==='')echo "OK";else echo($err);
exit();
}

